package LeetCode;

import java.util.*;

public class ectopicWordSubstring {
    public static void main(String[] args) {
        String s = "";
        String p = "";
        List<Integer> list = findAnagrams(s, p);
        for (Integer i : list) {
            System.out.print(i);
        }
    }

    public static List<Integer> findAnagrams(String s, String p) {
        List<Integer> list = new ArrayList<>();
        int length_s = s.length();
        int length_p = p.length();
        if (length_s < length_p) {
            return new ArrayList<Integer>();
        }


        int[] pCount = new int[26];
        int[] sCount = new int[26];
        for (int i = 0; i < length_p; i++) {
            pCount[p.charAt(i)-'a']++;
            sCount[s.charAt(i)-'a']++;
        }
        if (Arrays.equals(sCount,pCount)){
            list.add(0);
        }
        for(int i = 0; i < length_s - length_p; ++i) {
            sCount[s.charAt(i) - 'a']--;
            sCount[s.charAt(i+length_p) - 'a']++;
            if (Arrays.equals(sCount,pCount)){
                list.add(i+1);
            }
        }
//        Map<Character, Integer> pCount = new HashMap<>();
//        for (int i = 0; i < length_p; i++) {
//            pCount.put(p.charAt(i), pCount.getOrDefault(p.charAt(i), 0) + 1);
//        }
//
//        while (right < length_s) {
//            Map<Character, Integer> subCount = new HashMap<>();
//            for (int j = left; j <= right; j++) {
//                subCount.put(s.charAt(j), subCount.getOrDefault(s.charAt(j), 0) + 1);
//            }
//            if (subCount.equals(pCount)) {
//                list.add(left);
//            }
//            left++;
//            right++;
//        }
        return list;
    }


}
